comment:
도쿄구울 원작 만화랑 애니 전편 다 보고 정주행도 여러번 한 덕후로서 말씀드리는데요,
전 이거보고 전혀 도쿄구울 생각안났어요;
심지어 웹툰 보기전에도 애니 몇화 보고왔어요..;;

제발 같은 덕후들 이미지에 먹칠하지맙시다..정상적인 팬들 널리고 널렸는데 카구네니 뭐니 하면서 나불대시는데요,보기 불편합니다..
그만좀 표절이다,도쿄구울 생각나는건 뭐지, 이런짓 하지맙시다..

조합을 맞춰야지;;
탱 힐 없이 딜만 집어넣으니깐 털리는거아냐
딜말고 탱힐을 하라고;;

저도 도쿄구울 좋아하고, 트롤트랩 좋아하는데 
뭐만 하면 도쿄구울 표절이라고 빼애애액 거리는거 보기 싫습니다. 옆동네 테러맨도 그렇게 한동안 몰아가는 놈들 많던데 여기에도 득실하네요 참; 뭐만 하면 여기저기 도쿄구울 표절한거라니;

남의 창작물에 아무렇지도 않게 그런말을 싸지르고 다니는지 이해할수가 없네요. 공식적으로 확인된것도 없고 확실한증거도 없는데 그저 비슷한 분위기, 아주아주 조그만 설정만으로 함부로 내뱉는 애들보면 정말 화가 부글부글 끓습니다. 흰머리, 주인공의 비극등등은 여러 소재의 만화,웹툰에서도 볼수 있는건데 꼴랑 어디서 본거 있다고 쫄래쫄래 말하지맙시다. 우동사리같은 뇌는 숨겨도 모자랄판에 동네방네 홍보하고다니시는 분들 많이보이는데 제발 생각좀 하고 말하시길...

근데 트롤은 그냥은 못 죽인댓잖음 불로만 죽일 수 있고
근데 왜 쟤네는 그냥 칼로도 죽이는거
그리고 걍 수련만으로 저렇게 날아다닐 수 있나..;;

오덕들 ㅈㄴ싫어
학교에서 지 혼자 노래부르고 말투는 개ㅂㅅ. 심지어
지가 멋진줄앎ㄷㄷ;

아니 니들이 좋아하는거 나온건 알겠는데
그냥 그렇다 하고 지나가면 안돼냐
아는거 나오자마자 물고 늘어지네;

일본 만화 언급 안할래야 안할수가 없다. 저렇게 눈동자 없어지고 무표정되는거 7대죄 메리오다스 ㅈㄴ 겹치는데;;
심지어 팔부분만 변하는 거까지.. 겹치는 것도 적당히 겹쳐야지. 만화 사이트가서 7대죄 좀만 보면 안겹친다는 소리 절대로 못할거다 ㅋㅋㅋㅋㅋ

하지만 만화는 재밌게 보고있음 ㅎ

아빠가 트롤이가 엄마가 인간이라는 베댓은 뭐냐;;
베댓시켜준 인간은 또 뭐고 
웹툰 제대로안보나보네 하태는 이그니가 죽으면서 불씨에서 태어난 아이임
